original_question:
ਤਿਕੋਣ $ABC$ ਸਮਦੋਸ਼ੀ ਹੈ, ਜਿਸ ਵਿੱਚ $AB=AC$ ਅਤੇ ਉਚਾਈ $AM=11$ ਹੈ। ਮੰਨ ਲਵੋ ਕਿ $\overline{AM}$ 'ਤੇ ਇੱਕ ਬਿੰਦੂ $D$ ਹੈ ਜਿਸ ਨਾਲ $AD=10$ ਹੈ ਅਤੇ $\angle BDC=3\angle BAC$ ਹੈ। ਤਿਕੋਣ $ABC$ ਦਾ ਪਰਿਮਾਪ ਲੱਭੋ।

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

