original_question:
ਚਤੁਰਭੁਜ $ABCD$ ਦਾ ਕੇਂਦਰ $O$ ਹੈ ਅਤੇ $AB/AD=k$ ਹੈ। ਇੱਕ ਬਿੰਦੂ ਚਤੁਰਭੁਜ $ABCD$ ਦੇ ਅੰਦਰ randomly ਚੁਣਿਆ ਜਾਂਦਾ ਹੈ। ਇਸ ਗੱਲ ਦੀ ਸੰਭਾਵਨਾ ਕੀ ਹੈ ਕਿ ਇਹ $O$ ਦੇ ਨਜ਼ਦੀਕ ਹੈ ਬਜਾਏ ਕਿ ਚਾਰਾਂ ਕੋਣਾਂ ਵਿੱਚੋਂ ਕਿਸੇ ਵੀ ਕੋਣ ਦੇ?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

